import React from "react";
import { Container, Menu, Segment } from "semantic-ui-react";

export const NavBar = () => {
  return (
    
      <Menu fixed='top' inverted secondary>
        <Container>
      <Menu.Item header>
        <img src="/assets/logo.png" alt="logo" style={{marginRight: '10px',width:'90px'}} />
      </Menu.Item>
      <Menu.Item>Contacts</Menu.Item>  
        </Container>
       
      </Menu>

  );
};
